import axios from 'axios';

axios.interceptors.request.use(
  config => {
    config.baseURL = 'https://localhost:44354/api';
    return config;
  },
  error => {
    return Promise.reject(error);
  }
);

axios.interceptors.response.use(null, error => {
  return Promise.reject(error);
});

export default axios;
